<title>لوشن إزالة الشعر Bella</title>
<style>
:root{--pink:#f8d7df;--accent:#e64a76;--green:#4CAF50;--card-border:#f4cfd9;}
body{font-family:'Cairo',sans-serif;margin:0;background:#fff;color:#333;direction:rtl;}
.wrap{max-width:850px;margin:auto;padding:20px;}
.hero img{width:100%;max-width:450px;display:block;margin:auto;border-radius:10px;}
h1{text-align:center;color:var(--accent);margin:15px 0 5px;font-size:28px;}
p.lead{text-align:center;color:#666;}
.note{text-align:center;background:var(--pink);padding:10px;border-radius:8px;margin:20px 0;color:var(--accent);font-weight:600;}
.offers{display:flex;flex-wrap:wrap;gap:15px;justify-content:center;}
.offer{flex:1 1 350px;border:2px solid var(--card-border);border-radius:10px;padding:12px;text-align:center;cursor:pointer;background:#fff;transition:.3s;}
.offer:hover,.offer.selected{border-color:var(--accent);background:#fff4f8;box-shadow:0 3px 10px rgba(230,74,118,0.1);}
.offer img{width:100%;border-radius:8px;margin-bottom:10px;}
.offer h3{margin:6px 0;color:var(--accent);}
.offer p{margin:4px 0;color:#444;font-size:15px;}
form{margin-top:20px;border:1px solid #eee;border-radius:10px;padding:20px;}
input,textarea{width:100%;padding:12px;border-radius:8px;border:1px solid #ccc;margin-bottom:12px;font-size:15px;}
input:focus,textarea:focus{outline:none;border-color:var(--accent);}
button{width:100%;padding:14px;border:none;border-radius:10px;background:var(--accent);color:#fff;font-size:17px;cursor:pointer;transition:.3s;}
button[disabled]{opacity:0.8;cursor:default;}
.footer{text-align:center;color:#888;margin-top:15px;font-size:14px;}
@media(max-width:600px){.offers{flex-direction:column;}}
</style>

<h3>عرض 2: عبوتين + واحدة مجانًا</h3>
<p>650 جنيه + الشحن مجانًا</p>
<input type="radio" name="offer" value="عبوتين + واحدة مجانًا - 650 جنيه + الشحن مجانًا" required style="display:none">
</label>
</div>

<form id="orderForm">
<p style="color:#b43a5a;text-align:right;font-weight:600">✍️ املأ بياناتك، ثم اضغط "✔️ تأكيد الطلب الآن" وانتظر قليلاً حتى تظهر رسالة التأكيد</p>
<input type="text" name="name" placeholder="الاسم الكامل" required>
<input type="tel" name="phone" placeholder="رقم الموبايل" required>
<input type="text" name="governorate" placeholder="المحافظة" required>
<textarea name="address" rows="3" placeholder="منطقة , شارع , رقم البيت , بجوار مكان مشهور" required></textarea>
<button id="confirmBtn">✔️ تأكيد الطلب الآن</button>
<div class="footer">© 2025 Bella</div>
</form>
</div>

<script>
const offers = document.querySelectorAll('.offer');
offers.forEach(o=>{o.addEventListener('click',()=>{offers.forEach(x=>x.classList.remove('selected'));o.classList.add('selected');o.querySelector('input').checked=true;})});

const form=document.getElementById('orderForm');const btn=document.getElementById('confirmBtn');
form.addEventListener('submit',e=>{e.preventDefault();btn.disabled=true;btn.textContent='انتظر قليلاً...';btn.style.background='#999';
const data=new FormData(form);
fetch('https://script.google.com/macros/s/AKfycbzuZJ7gtSAnwPi8RQKOThHlrdrd-uod59G4rEc1CsvHygqdVv4fxfLLWSuIgqbGuDqJSg/exec',{method:'POST',body:data})
.then(r=>{fbq('track','Lead');btn.textContent='تم إرسال طلبك بنجاح ✅';btn.style.background='var(--green)';form.reset();offers.forEach(x=>x.classList.remove('selected'));})
.catch(err=>{alert('حدث خطأ أثناء الإرسال، حاول مرة أخرى');btn.disabled=false;btn.textContent='✔️ تأكيد الطلب الآن';btn.style.background='var(--accent)';});
});
</script>
</body>
</html>
